import { Container } from 'react-bootstrap';
import './test.css';

function Test(){

    let message = 'Just Any WORD';
    let Returner = () => {
        return 'Hi, World!'
    }

    return(
        <Container fluid>
            <div className = "container">
                <h1>Сообщение</h1>
                <button className = "button" onClick={alert(Returner)}>
                    Нажми на меня
                </button>
            </div>
        </Container>
    )
}

export default Test
